def merge_sort(n)
    if n.length <= 1
        return n
    else
        half = n.length/2
        left_array = merge_sort(n.slice(0...half))
        right_array = merge_sort(n.slice(half...n.length))
        merge(left_array, right_array)
    end
end

def merge(left, right)
    sorted_array = []
    while !left.empty? && !right.empty? do
        if left[0] < right[0]
            sorted_array.push(left.shift)
        else
            sorted_array.push(right.shift)
        end
    end
    return sorted_array + left + right
end

